import { Loader } from "@googlemaps/js-api-loader";
// import MarkerClusterer from "@google/markerclustererplus";

function displayMap() {
  const apiOptions = {
    apiKey: "AIzaSyDppxNKV5QddpqA90IuS0kWg9HTLOuJsGw",
  };
  const loader = new Loader(apiOptions);

  loader.load().then(() => {
    console.log("Maps JS API loaded");
    const map = displayMap(); //Line 19
    // const markers = addMarkers(map); //Line 29
    // clusterMarkers(map, markers); //Envokes line 60
    // addPanToMarker(map, markers); //Envokes line 65
  });

  const mapOptions = {
    center: { lat: 43.838413, lng: -79.086761 },
    zoom: 14,
  };

  const map = new google.maps.Map(mapOptions);
  return map;
}

export default displayMap;
